import React from "react";
import { Flex } from "rebass";
import { theme } from "../theme";
import Button from "../components/Button";

const ResourcesPage = () => {
  return (
    <Flex marigin={0} overflow="hidden" maxWidth="100%">
      <Flex
        justifyContent="center"
        alignItems="center"
        height="100vh"
        flexDirection="column"
        bg={theme.colors.jet}
      >
        <Flex marginTop={300} marginLeft={50} width="100%">
          <Button variant="action">Back</Button>
        </Flex>
      </Flex>
    </Flex>
  );
};

export default ResourcesPage;
